import styled from 'styled-components'


export default styled.div`
grid-area: DC;
display: flex;
flex-direction:row;

padding:10px;
div.Docs{
  flex-direction:column;
}
div.titlePrivateDocs{
  background-color: var(--senary);
  border-radius: 5px 0px 0px 0px;
  width:250px;
  height:40px;
  padding:7px;
  text-align: center;
}
div.titlePublicDocs{
  background-color: var(--senary);
  border-radius: 0px 5px 0px 0px;
  width:250px;
  height:40px;
  padding:7px;
  text-align: center;
}
div.privates{
  background-color: var(--secondary);
  border-radius: 0px 0px 0px 5px;
  width:250px;
  min-height:100px;
  padding:7px;
}
div.public{
  background-color: var(--secondary);
  border-radius: 0px 0px 5px 0px;
  width:250px;
  min-height:100px;
  padding:7px;
}
div.createDoc{
  form{
  flex-direction:column;
  }
}



`
